// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/UUPSUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC20/ERC20Upgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";

contract ConvictionVoting is Initializable, UUPSUpgradeable, OwnableUpgradeable {
    ERC20Upgradeable public token;
    uint256 public quorum;
    uint256 public convictionGrowthRate;
    uint256 public convictionDecayRate;

    enum ProposalType { Upgrade, Transfer }
    enum ProposalStatus { Active, Executed, Canceled, Expired, Approved }
    struct Proposal {
        ProposalType proposalType;
        address target;
        bytes callData;
        string description;
        uint256 votes;
        ProposalStatus status;
        uint256 expirationDate;
        address proposer;
        uint256 quorum;
    }

    struct Vote {
        uint256 proposalId;
        uint256 weight;
        uint256 timestamp;
    }

    Proposal[] public proposals;
    mapping(address => Vote[]) public userVotes;

    event Voted(address indexed voter, uint256 proposalId, uint256 weight, uint256 conviction);
    event VoteWithdrawn(address indexed voter, uint256 proposalId, uint256 conviction);
    event ProposalCreated(uint256 proposalId, ProposalType proposalType, address target, bytes callData, string description, uint256 expirationDate, uint256 quorum);
    event ProposalExecuted(uint256 proposalId);
    event ProposalCanceled(uint256 proposalId);
    event ProposalExpired(uint256 proposalId);
    event ProposalDeleted(uint256 proposalId);
    event QuorumUpdated(uint256 newQuorum);
    event ProposalApproved(uint256 proposalId);

    function initialize(
        address _token,
        address initialOwner,
        uint256 _initialQuorum,
        uint256 _convictionGrowthRate,
        uint256 _convictionDecayRate
    ) public initializer {
        __Ownable_init();
        __UUPSUpgradeable_init();
        token = ERC20Upgradeable(_token);
        quorum = _initialQuorum;
        convictionGrowthRate = _convictionGrowthRate;
        convictionDecayRate = _convictionDecayRate;
        transferOwnership(initialOwner);
    }

    function setQuorum(uint256 _quorum) external onlyOwner {
        quorum = _quorum;
        emit QuorumUpdated(_quorum);
    }

    function createProposal(
        ProposalType _proposalType,
        address _target,
        bytes calldata _callData,
        string calldata _description,
        uint256 _expirationDate
    ) external {
        require(token.balanceOf(msg.sender) >= 1 * 10**18, "Insufficient LOCKE token balance");

        bool transferSuccess = token.transferFrom(msg.sender, address(this), 1 * 10**18);
        require(transferSuccess, "Token transfer failed");

        require(_expirationDate == 0 || _expirationDate > block.timestamp, "Invalid expiration date");

        uint256 proposalQuorum = 2 * 10**18; // Quorum set to 2 LOCKE

        proposals.push(Proposal({
            proposalType: _proposalType,
            target: _target,
            callData: _callData,
            description: _description,
            votes: 0,
            status: ProposalStatus.Active,
            expirationDate: _expirationDate,
            proposer: msg.sender,
            quorum: proposalQuorum
        }));

        emit ProposalCreated(proposals.length - 1, _proposalType, _target, _callData, _description, _expirationDate, proposalQuorum);
    }

    function cancelProposal(uint256 _proposalId) external {
        require(_proposalId < proposals.length, "Invalid proposal");
        Proposal storage proposal = proposals[_proposalId];
        require(proposal.proposer == msg.sender || msg.sender == owner(), "Not authorized");
        require(proposal.status == ProposalStatus.Active, "Proposal not active");

        proposal.status = ProposalStatus.Canceled;

        token.transfer(proposal.proposer, 1 * 10**18);

        emit ProposalCanceled(_proposalId);
    }

    function deleteProposal(uint256 _proposalId) external {
        require(_proposalId < proposals.length, "Invalid proposal");
        Proposal storage proposal = proposals[_proposalId];
        require(proposal.proposer == msg.sender, "Not authorized");
        require(proposal.status == ProposalStatus.Active, "Proposal not active");

        proposal.status = ProposalStatus.Canceled;

        token.transfer(proposal.proposer, 1 * 10**18);

        emit ProposalDeleted(_proposalId);
    }

    function vote(uint256 _proposalId, uint256 _weight) external {
        require(_proposalId < proposals.length, "Invalid proposal");
        Proposal storage proposal = proposals[_proposalId];
        require(proposal.status == ProposalStatus.Active, "Proposal not active");
        require(_weight >= 1, "Must stake at least 1 token");
        require(proposal.expirationDate == 0 || proposal.expirationDate > block.timestamp, "Proposal expired");
        require(token.balanceOf(msg.sender) >= _weight, "Insufficient token balance to vote");

        token.transferFrom(msg.sender, address(this), _weight);

        uint256 currentTime = block.timestamp;
        uint256 conviction = _calculateConviction(_weight, currentTime, currentTime);

        userVotes[msg.sender].push(Vote({
            proposalId: _proposalId,
            weight: _weight,
            timestamp: currentTime
        }));

        proposal.votes += conviction;

        emit Voted(msg.sender, _proposalId, _weight, conviction);
    }

    function withdrawVote(uint256 _voteIndex) external {
        require(_voteIndex < userVotes[msg.sender].length, "Invalid vote index");

        Vote storage userVote = userVotes[msg.sender][_voteIndex];
        Proposal storage proposal = proposals[userVote.proposalId];

        uint256 currentTime = block.timestamp;
        uint256 conviction = _calculateConviction(userVote.weight, userVote.timestamp, currentTime);
        uint256 decayedConviction = conviction * (100 - convictionDecayRate) / 100;

        proposal.votes -= decayedConviction;

        uint256 weight = userVote.weight;
        userVotes[msg.sender][_voteIndex] = userVotes[msg.sender][userVotes[msg.sender].length - 1];
        userVotes[msg.sender].pop();

        token.transfer(msg.sender, weight);

        emit VoteWithdrawn(msg.sender, userVote.proposalId, decayedConviction);
    }

    function _calculateConviction(uint256 weight, uint256 startTime, uint256 endTime) internal view returns (uint256) {
        uint256 timeElapsed = endTime - startTime;
        return weight * (1 + convictionGrowthRate / 100) ** timeElapsed;
    }

    function executeProposal(uint256 _proposalId) external {
        require(_proposalId < proposals.length, "Invalid proposal");
        Proposal storage proposal = proposals[_proposalId];
        require(proposal.status != ProposalStatus.Executed, "Proposal already executed");

        if (proposal.status == ProposalStatus.Expired || proposal.status == ProposalStatus.Approved) {
            require(proposal.votes >= proposal.quorum, "Quorum not reached");
        }

        if (proposal.status == ProposalStatus.Active && block.timestamp >= proposal.expirationDate) {
            if (proposal.votes >= proposal.quorum) {
                proposal.status = ProposalStatus.Approved;
            } else {
                proposal.status = ProposalStatus.Expired;
                emit ProposalExpired(_proposalId);
                return;
            }
        }

        require(proposal.status == ProposalStatus.Approved, "Proposal not approved");

        (bool success, ) = proposal.target.call(proposal.callData);
        require(success, "Proposal execution failed");

        proposal.status = ProposalStatus.Executed;

        if (proposal.proposalType == ProposalType.Transfer) {
            (address recipient, uint256 amount) = abi.decode(proposal.callData, (address, uint256));
            token.transfer(recipient, amount);
        }

        token.transfer(proposal.proposer, 1 * 10**18);

        emit ProposalExecuted(_proposalId);
    }

    function _authorizeUpgrade(address newImplementation) internal override onlyOwner {}

    function getProposals() external view returns (Proposal[] memory) {
        return proposals;
    }

    function proposalCount() external view returns (uint256) {
        return proposals.length;
    }
}

