// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.17;

import "hardhat/console.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC20/ERC20Upgradeable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/security/ReentrancyGuardUpgradeable.sol";

contract Token is Initializable, ERC20Upgradeable, OwnableUpgradeable, ReentrancyGuardUpgradeable {
    string private _logoURI; // Variable to store the IPFS URI of the token logo

    // Events to log important actions
    event TokensBurned(address indexed burner, uint256 amount);
    event LogoURIUpdated(string newLogoURI);

    function initialize(address initialOwner, string memory _initialLogoURI) public initializer {
        __ERC20_init("Locke Token", "LOCKE");
        __Ownable_init();  // Ensure initialOwner is correctly set
        __ReentrancyGuard_init();      // Initialize reentrancy guard

        uint256 _totalSupply = 1000000 * 10**decimals(); // Adjusting total supply to include decimals
        _mint(initialOwner, _totalSupply);

        _logoURI = _initialLogoURI; // Set the token logo URI
    }

    // Function to get the token logo URI
    function logoURI() public view returns (string memory) {
        return _logoURI;
    }

    function balanceOf(address account) public view override returns (uint256) {
        return super.balanceOf(account);
    }

    function ownerTransfer(address to, uint256 amount) external onlyOwner nonReentrant {
        require(balanceOf(owner()) >= amount, "Not enough tokens in owner's balance");
        _transfer(owner(), to, amount);
    }

    function approve(address spender, uint256 amount) public override returns (bool) {
        return super.approve(spender, amount);
    }

function allowance(address tokenOwner, address spender) public view override returns (uint256) {
    return super.allowance(tokenOwner, spender);
}


    // Allows any account to burn their own tokens
    function burn(uint256 amount) public nonReentrant {
        require(amount > 0, "Amount to burn must be greater than zero");
        _burn(msg.sender, amount);
        emit TokensBurned(msg.sender, amount); // Log the burn event
    }

    // Allows only the owner to burn tokens from the owner's balance
    function ownerBurn(uint256 amount) external onlyOwner nonReentrant {
        require(amount > 0, "Amount to burn must be greater than zero");
        require(balanceOf(owner()) >= amount, "Not enough tokens in owner's balance to burn");
        _burn(owner(), amount);
        emit TokensBurned(owner(), amount); // Log the burn event
    }

    // Function to update the token logo URI (only by the owner)
    function updateLogoURI(string memory newLogoURI) external onlyOwner {
        _logoURI = newLogoURI;
        emit LogoURIUpdated(newLogoURI); // Log the logo URI update event
    }
}

